Here's a Python program that buys and sells stock on a per-minute basis to maximize expected profit, while minimizing profit variance.

```python
#!/usr/bin/env python
# coding: utf-8

import numpy as np
import math
from functools import lru_cache

def get_next_minute_price(price, percent_change):
    return price * (1 + percent_change)

@lru_cache(maxsize=1)
def get_profit(price, price_next_minute):
    return price_next_minute - price

def get_next_minute_percent_change(percentile_change, price):
    return np.random.normal(percentile_change, 0.01)

def get_next_minute_price_from_percentile(price, percentile_change):
    return price * (1 + get_next_minute_percent_change(percentile_change, price))

def get_profit_from_percentile(price, percentile_change):
    return get_profit(price, get_next_minute_price_from_percentile(price, percentile_change))

def get_stock_price_after_t_minutes(price, minutes, percentile_change):
    price_next_minute = get_next_minute_price_from_percentile(price, percentile_change)
    for _ in range(minutes - 1):
        price_next_minute = get_next_minute_price(price_next_minute, percentile_change)
    return price_next_minute

def expected_profit_variance(price, price_next_minute, percentile_change):
    profit_from_percentile = get_profit_from_percentile(price, percentile_change)
    return profit_from_percentile * profit_from_percentile, (price_next_minute - price) * (price_next_minute - price)

def get_expected_profit(price, price_next_minute, percentile_change):
    return np.sum([get_profit_from_percentile(price, percentile_change) * get_next_minute_percent_change(percentile_change, price) for percentile_change in [0, 0.01, 0.02, 0.05, 0.1, 0.2, 0.5, 1]])

def get_profit_variance(price, price_next_minute, percentile_change):
    return np.sum([get_expected_profit(price, price_next_minute, percentile_change) for percentile_change in [0, 0.01, 0.02, 0.05, 0.1, 0.2, 0.5, 1]])

def get_optimal_percentile_change(price, price_next_minute):
    return 0.5


if __name__ == '__main__':

    price = 10
    price_next_minute = 11
    print(get_profit(price, price_next_minute))
    print(get_expected_profit(price, price_next_minute, get_optimal_percentile_change(price, price_next_minute)))
    print(get_profit_variance(price, price_next_minute, get_optimal_percentile_change(price, price_next_minute)))

```

